    "2016-02-26T18:47:38.332400",nt"name": "nist-recommended-rest-frequencies-for-observed-interstellar-molecular-microwave-transition",nt"isopen":
    true,nt"url": null,nt"notes": "This database contains critically evaluated
    transition frequencies for the molecular transitions detected in interstellar and
    circumstellar clouds reported in the literature through mid-2008. The tabulated
    transition frequencies are recommended for reference in future astronomical observations
    in the centimeter and millimeter wavelength regions. The transition frequencies
    have been selected through a critical examination and analysis of the laboratory
    spectral data obtained from the literature. The information tabulated includes the
    species identity, transition frequency, uncertainty, and quantum state labels. For
    convenience, representative line antenna temperatures are listed for a typical astronomical
    source for each transition, and the references are cited for the laboratory and
    astronomical literature that have been employed.   2009 Revision",nt"license_title":
